Using with nodejs
This code snippet uses HistoryTools.js to load some client WASMs:
const HistoryTools = require('.../path/to/HistoryTools.js');
const fs = require('fs');
const { TextDecoder, TextEncoder } = require('util');
const fetch = require('node-fetch');
const encoder = new TextEncoder('utf8');
const decoder = new TextDecoder('utf8');

function prettyPrint(title, json) {
    console.log('\n' + title + '\n====================');
    console.log(JSON.stringify(JSON.parse(json), null, 4));
}

(async () => {
    try {
        const chainClientWasm = await HistoryTools.createClientWasm({
            mod: new WebAssembly.Module(fs.readFileSync('.../path/to/chain-client.wasm')),
            encoder, decoder
        });

        const tokenClientWasm = await HistoryTools.createClientWasm({
            mod: new WebAssembly.Module(fs.readFileSync('.../path/to/token-client.wasm')),
            encoder, decoder
        });

        // ... insert code examples from below here ...

    } catch (e) {
        console.log(e);
    }
})()

Examining schemas
The describeQueryRequest and describeQueryResponse methods return JSON schemas:
prettyPrint('Token Request Schema', tokenClientWasm.describeQueryRequest());
prettyPrint('Token Response Schema', tokenClientWasm.describeQueryResponse());

Creating query requests
The createQueryRequest method converts query requests from JSON to binary:
// Create a request: generate TAPOS fields needed for a transaction
const request0 = chainClientWasm.createQueryRequest(JSON.stringify(
    ['tapos', {
        ref_block: ['head', -10],    // 10 blocks behind head
        expire_seconds: 60,          // Expire 60 seconds after that block
    }]
));

// Create a request: get a range of accounts
const request1 = chainClientWasm.createQueryRequest(JSON.stringify(
    ['account', {
        snapshot_block: ['head', 0],
        first: 'eosio',
        last: 'eosio.zzzzzz',
        max_results: 100,
        include_code: false,
        include_abi: false,
    }]
));

// Create a request: get tokens (from multiple contracts) owned by `eosio`
const request2 = tokenClientWasm.createQueryRequest(JSON.stringify(
    ['bal.mult.tok', {
        snapshot_block: ['head', 0],
        account: 'eosio',
        first_key: { sym: '', code: '' },
        last_key: { sym: 'ZZZZZZZ', code: 'zzzzzzzzzzzzj' },
        max_results: 10,
    }]
));

Combining the request, sending it, and splitting the response.
The combineRequests function combines multiple requests into a single wasm-ql request. The
splitResponses function splits up multiple replies from a single binary. Both functions
are required even when there's only 1 request.
// Query wasm-ql server
const queryReply = await fetch('http(s)://server.name:port/wasmql/v1/query', {
    method: 'POST',
    body: HistoryTools.combineRequests([
        request0,
        request1,
        request2
    ]),
});
if (queryReply.status !== 200)
    throw new Error(queryReply.status + ': ' + queryReply.statusText + ': ' + await queryReply.text());

// Split up responses
const responses = HistoryTools.splitResponses(new Uint8Array(await queryReply.arrayBuffer()));

Converting responses to JSON
The decodeQueryResponse method converts responses from binary to JSON. Call it 
from the WASM which generated the matching query.
// Look at responses
prettyPrint('tapos', chainClientWasm.decodeQueryResponse(responses[0]));
prettyPrint('accounts', chainClientWasm.decodeQueryResponse(responses[1]));
prettyPrint('tokens', tokenClientWasm.decodeQueryResponse(responses[2]));

creating-wasms.html.body:
Creating WASMs
The sources for a minimal WASM pair include:

A common header (my.hpp)
A server implementation (my-server.cpp)
A client implementation (my-client.cpp)

Header
The header declares the set of available queries and responses. Here's an example header for a WASM pair which can query token balances for a range of accounts.
// my.hpp

#pragma once
#include 
#include 

// Parameters for a query
struct get_my_tokens_request {
    eosio::block_select snapshot_block = {};
    eosio::name         code           = {};
    eosio::symbol_code  sym            = {};
    eosio::name         first_account  = {};
    eosio::name         last_account   = {};
    uint32_t            max_results    = {};
};

// Enables JSON <> binary conversion
STRUCT_REFLECT(get_my_tokens_request) {
    STRUCT_MEMBER(get_my_tokens_request, snapshot_block)
    STRUCT_MEMBER(get_my_tokens_request, code)
    STRUCT_MEMBER(get_my_tokens_request, sym)
    STRUCT_MEMBER(get_my_tokens_request, first_account)
    STRUCT_MEMBER(get_my_tokens_request, last_account)
    STRUCT_MEMBER(get_my_tokens_request, max_results)
}

// A single balance
struct token_balance {
    eosio::name           account = {};
    eosio::extended_asset amount  = {};
};

STRUCT_REFLECT(token_balance) {
    STRUCT_MEMBER(token_balance, account)
    STRUCT_MEMBER(token_balance, amount)
}

// Query response
struct get_my_tokens_response {
    std::vector balances = {};
    std::optional more     = {};

    EOSLIB_SERIALIZE(get_my_tokens_response, (balances)(more))
};

STRUCT_REFLECT(get_my_tokens_response) {
    STRUCT_MEMBER(get_my_tokens_response, balances)
    STRUCT_MEMBER(get_my_tokens_response, more)
}

// The set of available queries. Each query has a name which identifies it.
using my_query_request = eosio::tagged_variant>;

// The set of available responses. Each response has a name which identifies it.
// The name must match the request's name.
using my_query_response = eosio::tagged_variant>;

Server WASM
The server WASM uses the database to find answers to incoming requests.
// my-server.cpp

#include "my.hpp"
#include 
#include 

// process this query
void process(get_my_tokens_request& req, const eosio::database_status& status) {

    // query the database for a range of contract rows,
    // ordered by (code, table, primary_key, scope)
    auto s = query_database(eosio::query_contract_row_range_code_table_pk_scope{
        // look at this point in time
        .snapshot_block = get_block_num(req.snapshot_block, status),

        // get records with keys >= first
        .first =
            {
                .code        = req.code,
                .table       = "accounts"_n,
                .primary_key = req.sym.raw(),
                .scope       = req.first_account.value,
            },

        // get records with keys (s, [&](eosio::contract_row& r, eosio::asset* a) {
        // let requestor know how to continue the search
        response.more = eosio::name{r.scope + 1};

        // if the row is present and contains a valid asset, record the result
        if (r.present && a)
            response.balances.push_back({
                .account = eosio::name{r.scope},
                .amount = eosio::extended_asset{*a, req.code}
            });

        // continue the loop
        return true;
    });

    // send the result to the requestor
    eosio::set_output_data(pack(my_query_response{std::move(response)}));
}

// initialize this WASM
extern "C" __attribute__((eosio_wasm_entry)) void initialize() {}

// wasm-ql calls this for each incoming query
extern "C" void run_query() {
    // deserialize the request
    auto request = eosio::unpack(eosio::get_input_data());

    // dispatch the request to the appropriate `process` overload
    std::visit([](auto& x) { process(x, eosio::get_database_status()); }, request.value);
}

Client WASM
The client WASM converts between JSON and the binary format the server WASM understands
// my-client.cpp

#include "my.hpp"
#include 
#include 
#include 

// initialize this WASM
extern "C" __attribute__((eosio_wasm_entry)) void initialize() {}

// produce JSON schema for request
extern "C" void describe_query_request() {
    eosio::set_output_data(eosio::make_json_schema());
}

// produce JSON schema for response
extern "C" void describe_query_response() {
    eosio::set_output_data(eosio::make_json_schema());
}

// convert request from JSON to binary
extern "C" void create_query_request() {
    eosio::set_output_data(pack(std::make_tuple(
        "local"_n,      // must be "local"
        "my"_n,         // name of server WASM
        eosio::parse_json(eosio::get_input_data()))));
}

// convert response from binary to JSON
extern "C" void decode_query_response() {
    eosio::set_output_data(to_json(eosio::unpack(eosio::get_input_data())));
}

Building
Use the CDT to build the WASMs:
# Location of History Tools repository
export HT_TOOLS_DIR=~/history-tools

# Location of the CDT
export CDT_DIR=/usr/local/eosio.cdt

$CDT_DIR/bin/eosio-cpp                                                      \
    -Os                                                                     \
    -I $HT_TOOLS_DIR/libraries/eosiolib/wasmql                              \
    -I $HT_TOOLS_DIR/external/abieos/external/date/include                  \
    $HT_TOOLS_DIR/libraries/eosiolib/wasmql/eosio/temp_placeholders.cpp     \
    -fquery-server                                                          \
    --eosio-imports=$HT_TOOLS_DIR/libraries/eosiolib/wasmql/server.imports  \
    my-server.cpp                                                           \
    -o my-server.wasm

$CDT_DIR/bin/eosio-cpp                                                      \
    -Os                                                                     \
    -I $HT_TOOLS_DIR/libraries/eosiolib/wasmql                              \
    -I $HT_TOOLS_DIR/external/abieos/external/date/include                  \
    $HT_TOOLS_DIR/libraries/eosiolib/wasmql/eosio/temp_placeholders.cpp     \
    -fquery-client                                                          \
    --eosio-imports=$HT_TOOLS_DIR/libraries/eosiolib/wasmql/client.imports  \
    my-client.cpp                                                           \
    -o my-client.wasm

Deploying
Place my-server.wasm in the directory that wasm-ql's --wql-wasm-dir option points to. Make my-client.wasm available to clients.
Example use
Modify the code in Using Client WASMs:
// Use this for browsers:
const myClientWasm = await HistoryTools.createClientWasm({
    mod: await WebAssembly.compileStreaming(fetch('.../path/to/my-client.wasm')),
    encoder, decoder
});

// Use this for nodejs
const myClientWasm = await HistoryTools.createClientWasm({
    mod: new WebAssembly.Module(fs.readFileSync('.../path/to/my-client.wasm')),
    encoder, decoder
});

// Use this for either:
const request = myClientWasm.createQueryRequest(JSON.stringify(
    ['get.my.toks', {
        snapshot_block: ['head', 0],
        code: 'eosio.token',
        sym: 'EOS',
        first_account: 'eosio',
        last_account: 'eosio.zzzzzz',
        max_results: 10,
    }]
));

const queryReply = await fetch('http(s)://server.name:port/wasmql/v1/query', {
    method: 'POST',
    body: HistoryTools.combineRequests([
        request,
    ]),
});
if (queryReply.status !== 200)
    throw new Error(queryReply.status + ': ' + queryReply.statusText + ': ' + await queryReply.text());

const responses = HistoryTools.splitResponses(new Uint8Array(await queryReply.arrayBuffer()));

prettyPrint('The tokens', myClientWasm.decodeQueryResponse(responses[0]));

balance-snapshot.html.body:
Balance Snapshot Example
This example collects a snapshot of system token balances. At a requested block number it collects these for all accounts and saves the result
to a .csv file:

Liquid system token balances
Staked balances
Pending stake refunds

It automatically determines the system token from the system contract's rammarket table. This example makes the following assumptions:

The example eosio.system contract in https://github.com/EOSIO/eosio.contracts is installed and initialized on the eosio account.
The example eosio.token contract in https://github.com/EOSIO/eosio.contracts is installed on the eosio.token account and manages the system token.

Note: use the update_eosio_token_to_cdt1.6 branch (temporary) of eosio.contracts during build.
balance.snap.hpp
#pragma once
#include 
#include 

struct base_request {
    uint32_t    block         = {};
    eosio::name first_account = {};
};

STRUCT_REFLECT(base_request) {
    STRUCT_MEMBER(base_request, block)
    STRUCT_MEMBER(base_request, first_account)
}

struct get_liquid_request : base_request {};
struct get_staked_request : base_request {};
struct get_refund_request : base_request {};

struct balance {
    eosio::name account = {};
    int64_t     amount  = {};
};

STRUCT_REFLECT(balance) {
    STRUCT_MEMBER(balance, account)
    STRUCT_MEMBER(balance, amount)
}

struct base_response {
    std::vector       balances = {};
    std::optional more     = {};

    EOSLIB_SERIALIZE(base_response, (balances)(more))
};

STRUCT_REFLECT(base_response) {
    STRUCT_MEMBER(base_response, balances)
    STRUCT_MEMBER(base_response, more)
}

struct get_liquid_response : base_response {};
struct get_staked_response : base_response {};
struct get_refund_response : base_response {};

using balance_snap_query_request = eosio::tagged_variant,
    eosio::tagged_type,
    eosio::tagged_type>;

using balance_snap_query_response = eosio::tagged_variant,
    eosio::tagged_type,
    eosio::tagged_type>;

balance.snap-server.hpp
